        dcGYaZW4XcL4kRuCkRWRDK: 'Гражданско-правовая\nСопровождение сделок с недвижимым имуществом:\n•\tЮридическая экспертиза объектов недвижимости (due diligence);\n•\tСопровождение инвестиционных проектов в области строительства жилой и коммерческой недвижимости, в том числе разработка договорных структур, подготовка инвестиционных договоров, договоров о совместной деятельности, договоров подряда, иных соглашений;\n•\tКомплексное сопровождение сделок по приобретению жилой и коммерческой недвижимости в России, Великобритании, странах Евросоюза, Болгарии, США и странах Африки;\n•\tРазработка строительной контрактной документации, сопровождение контрактов и юридическое консультирование строительных проектов;\n•\tСопровождение арендного бизнеса, подготовка арендных соглашений.\nСопровождение сделок и инвестиционных проектов:\n•\tСопровождение сделок по продаже/приобретению акций/долей в девелоперских и строительных компаниях, а также привлечению финансовых инвесторов (M& A);\n•\tРазработка оптимальных целевых структур владения, управления и операционных структур групп компаний, осуществляющих деятельность в указанной сфере, с целью уменьшения рисков и повышения степени защиты активов;\nСопровождение споров в сфере недвижимости:\n•\tПредставление интересов в российских судах по всем вопросам законодательства в сфере недвижимости, в том числе сопровождение споров, связанных с приватизацией, земельными правоотношениями, строительством, куплей-продажей или арендой недвижимости и т. д.;\n•\tДосудебные процедуры урегулирования конфликтов, медиация.\nНалоговое консультирование и сопровождение налоговых споров:\n•\tСудебное и досудебное оспаривание претензий налоговых органов как по общим, так и частным вопросам отрасли;\n•\tСопровождение налоговых проверок, анализ налоговых рисков, полноты применения льгот и рисков наличия трансфертного ценообразования.\n',
