        dcGYaZW4XcL4kRuCkRWRDK: 'УГоловное право (защита и представительство по экономическим и налоговым преступлениям, преступлениям коррупционной направленности).\r\nПравовое сопровождение деятельности различных бизнес-структур, приведение бизнеса в состояние максимальной эффективности, в частности, путем его реструктуризации или изменения основных управленческих параметров.\r\nПроведение юридических проверок, оценка рисков и выработка рекомендаций по наиболее эффективному и юридически защищенному построению бизнес-структур (холдинги, ассоциации, иные формы объединения).\r\nРазработка схем инвестирования, приобретения активов, включая ценные бумаги и недвижимость, обеспечение их правовой защиты.\r\nСопровождение сделок M&A, включая проведение юридического аудита, разработка структуры сделки, подготовка всех необходимых решений органов управления компаниями, разработка договоров, включая обеспечительные мероприятия, выполнение иных необходимых действий при совершении сделки.\r\nЗащита от незаконных действий при слияниях и поглощениях, в том числе в форме рейдерства.',
