        aWahm6WPvdWRfXfW11W49N: 'Практика более 23 лет.\nОкончил в 1997 году Ярославский Государственный Университет им. П.Г. Демидова сразу по двум специальностям - «Юриспруденция» и «Политология». Еще студентом  начал работать юристом на предприятии, где занимался вопросами лицензирования, договорной и  судебной работой.  Кроме этого, в это время активно занимался избирательным правом. В 2000 году возглавил крупнейшую юридическую фирму в регионе. В 2005 г.  прошел профессиональную стажировку в США  в Университете Мэриленда в Балтиморе (School of Law) и Американском университете (Вашингтон). После этого полностью посвятил себя судебному представительству. За все время практики сопровождал множество судебных споров. В сфере профессиональных интересов – бракоразводные дела, земельные споры, споры с недвижимостью, ценные бумаги, миграционное право, электоральное право. Но наибольший потенциал накоплен именно в процессуальных аспектах ведения судебных дел.  В свободное от работы время увлекаюсь спортом, осваиваю яхтинг,  занимаюсь музыкой.\n',
