        aWahm6WPvdWRfXfW11W49N: 'Высшее образовании:\r\nВолГУ (Волгоградский государственный университет), ВЫПУСК  - 2003, юриспруденция.\r\n\r\nПовышение квалификации, курсы:\r\nВолГУ, 2013г. Налоговый консультант\r\n\r\nОпыт работы: \r\nДекабрь 2018 — декабрь 2019\r\n1 год 1 месяц\r\nООО ЦАП "Ваше Право", Москва, www.washeprawo.ru/about/\r\nУслуги для бизнеса. \r\nЮрист\r\nСоставление процессуальных документов (иски, ходатайства, возражения, апелляционные жалобы и т.д.), анализ заключений судебных экспертов и и выявление допущенных судебными экспертами нарушений.\r\nАвгуст 2009 — октябрь 2018\r\n9 лет 3 месяца\r\nАНО "Юридическое агентство "Титул"\r\nУслуги для бизнеса\r\nЮрисконсульт/юрист\r\nПредставление интересов страховых компаний по искам физических лиц о взыскании страховых выплат, представление интересов банков о взыскании задолженности и обращении взыскания на заложенное имущество, исполнение решений суда в исполнительном производстве. Арбитраж (составление исков, сопровождение клиента в процессе и в исполнительном производстве), ведение дел в судах общей юрисдикции (составление исков, сопровождение клиента в процессе во всех инстанциях (апелляция, кассация, надзор) и в исполнительном производстве). Составление договоров. Регистрация и перерегистрация юридических лиц и предпринимателей. Консультирование по вопросам налогового, гражданского, семейного, наследственного права и др. месте работы.\r\nЯнварь 2013 — декабрь 2016\r\n4 года\r\nРосгосстрах\r\nВолгоград, www.rgs.ru\r\nФинансовый сектор... \r\nСтраховой агент\r\nПоиск клиентов, заключение договоров страхования.\r\nОктябрь 2009 — апрель 2010\r\n7 месяцев\r\nКредитный потребительский кооператив граждан "Росгражданкредит"\r\nРоссия\r\nюрист\r\nОрганизация находилась в стадии банкротства. Под руководством арбитражного управляющего выполняла работу по взысканию задолженности в досудебном порядке, в судах общей юрисдикции, принудительное исполнение решений суда, оспаривание действий судебных приставов, трудовое право,совмещение обязанностей начальника отдела кадров.\r\nАпрель 2003 — август 2009\r\n6 лет 5 месяцев\r\nООО "Спецкислородмонтаж"\r\nСтроительство, недвижимость, эксплуатация, проектирование... Показать еще\r\nЮрисконсульт/юрист\r\nАрбитраж, суд общей юрисдикции, гражданское право, трудовое право, составление договоров, претензионная работа.\r\nФевраль 2003 — апрель 2003\r\n3 месяца\r\nЗАО "Кислородмонтаж"\r\nСтроительство, недвижимость, эксплуатация, проектирование... Показать еще\r\nЮрист\r\nАрбитраж, суд общей юрисдикции, гражданское право, трудовое право, составление договоров, претензионная работа.\r\nКлючевые навыки: Опыт судебных разбирательств; Пользователь ПК; Судопроизводство; Регистрация юридических лиц\r\nВзыскание задолженности; Претензионная работа, Исполнительное производство.\r\nОбо мне:\r\nОтветственная, скрупулёзная, внимательная, доброжелательная, позитивная. Не хочу останавливаться в профессиональном развитии.\r\n\r\n\r\n',
