        dcGYaZW4XcL4kRuCkRWRDK: 'Оказание юридических услуг населению по консультированию составлению обращений процессуального и внесудебного  характера, представлению интересов в судах общей юрисдикции, органах власти и иных учреждениях.\nВедение дел в Арбитражных судах. \nОпыт судебной работы по административным делам (споры с УФМС, УФАС, Роспотребнадзор, Управление по ОНД МЧС, Управлене КС и ЖКХ).\nЮридическое сопровождение организаций. \nЗащита по уголовным делам различной категории сложности как на стадии предварительного расследования, так и в судах первой, кассационной и надзорной инстанций (должностные преступления, преступления в сфере экономики, преступления против личности, против общественной безопасности).\nАдвокатское расследование: сбор и анализ доказательств, \nработа с экспертными учреждениям.\nБизнес-проверка контрагентов. \nСоставление и подача адвокатских запросов.\nСовместная  деятельность с рядом независимых правозащитных и адвокатских образований ( "АГОРА", "Общественный Вердикт", "Байкальский провозащитный центр"). Результат данной вышеуказанной деятельности - \nзащита прав граждан (обвиняемых/ осужденных/потерпевших),  пересмотр решений, в том числе вступивших в законную силу судами надзорных и кассационных инстанций.\nОбжалование решений судов в ЕСПЧ.\nВедение дел на стадии исполнительного производства.\nВзыскание дебиторской задолженности, контроль реализации приставами требований исполнительных листов (судебных приказов).\nОформление сделок с недвижимым имуществом (в том числе с использованием средств ипотечного кредитования юридических лиц). \nПроверка истории недвижимости и юридической чистоты сделки.\nРегистрация, внесение изменений в учредительные документы юридических лиц.\nОпыт юридического сопровождения избирательных компаний на территории Иркутской области "под ключ".\n',
