        aWahm6WPvdWRfXfW11W49N: 'Опыт работы: \r\nQuesta Consulting (май 2017 - н.в.)\r\nВедущий Юрисконсульт по сопровождению процедур банкротства\r\n- Комплексное сопровождение процедур банкротства с даты введения процедуры вплоть до завершения, выработка стратегии, подходящей к каждой конкретной процедуре \u2028- Сопровождение процедур банкротства как со стороны должника, так и со стороны кредитора (работа с процедурами с участием залоговых кредиторов - кредитных организаций) \u2028- Успешное сопровождение проектов по оспариванию сделок в рамках дела о банкротстве, обжалование действий/бездействий арбитражных управляющих, отстранение арбитражных управляющих\u2028- Успешное привлечение к ответственности лиц, контролирующих должника. \u2028- Обжалование в апелляционном, кассационном порядке судебных актов\u2028- Отслеживание хода дела о банкротстве, ведение графиков судебных дел\u2028- Юридическая защита интересов клиентов компании по смежным проектам \u2028- Аналитика судебной практики\u2028- Написание правовых позиций и процессуальных документов\u2028- Проведение торгов в рамках дела о банкротстве, урегулирование разногласий \u2028- Участие в судебных заседаниях по взысканию дебиторской задолженности, виндикации имущества.\u2028- Подготовка документов к собранию кредиторов, отчётов арбитражного управляющего, ответы на запросы лиц, участвующих в деле о банкротстве\r\n\r\nЛемчик, Крупский и Партнеры, ООО (апрель 2016 - март 2015)\r\nМладший юрист - Помощник арбитражного управляющего\r\n- комплексное сопровождение процедур банкротства более 10 компаний, в частности крупных должников (дочерней компании ООО "Трансаэро", строительных компаний )\u2028- конкурсное управление - формирование  конкурсной массы должника, проведения инвентаризации, подбор документов для взыскания задолженности. \u2028- успешное взыскание дебиторской задолженности, претензионная работа с контрагентами, подготовка исковых заявлений\u2028- успешное судебное представительство по всем вопросам банкротных процедур, включение в реестр требований кредиторов, введение процедур банкротства, установление вознаграждения арбитражному управляющему\u2028- подготовка документов к собранию кредиторов, отчётов Арбитражного управляющего, ответы на запросы лиц, участвующих в деле о банкротстве \u2028- оспаривание сделок должника, в частности оспаривание неправомерных списаний ФНС, ФСС, ПФР \u2028- работа с госорганами, банками, ССП\u2028- работа в сфере трудовых отношений (увольнение работников должника)\u2028- ведение самостоятельных проектов\r\n\r\nМировой судья судебного участка г. Москвы (январь 2015 - август 2015)\r\nМосква \r\nЗаведующий канцелярией мирового судьи/помощник судьи\r\n- полный цикл делопроизводства на обособленном участке от регистрации документов до их исполнения\u2028- составление статистической отчетности\u2028- анализ законодательства по заданию руководителя\u2028- составление проектов документов\u2028- переписка с контрагентами по юридическим вопросам\u2028- проведения юридического анализа\u2028- подготовка пакета документов для последующей передачи их в другие инстанции\r\n\r\nОбразование:\r\nБакалавриат:\r\nНациональный исследовательский университет "Высшая школа экономики", Москва\r\nФакультет права, Юриспруденция\r\nМагистратура:\r\nМГЮА им. Кутафина\r\nЮридический факультет, корпоративное право',
